require 'benchmark'

# @param {String} s
# @param {Integer} x
# @param {Integer} y
# @return {Integer}
def maximum_gain(s, x, y)
  gain = 0
  str = s
  part1, score1, part2, score2 = x > y ? ['ab', x, 'ba', y] : ['ba', y, 'ab', x]
  iter_count = 0
  loop do
    iter_count += 1
    loop do
      str, count = del_gsub(str, part1)
      gain += score1 * count
      break if count.zero?

      iter_count = 0
    end
    break if iter_count > 1

    iter_count += 1
    loop do
      str, count = del_gsub(str, part2)
      gain += score2 * count
      break if count.zero?

      iter_count = 0
    end
    break if iter_count > 1
  end
  gain
end

def del_gsub(s, sub_str)
  str = s.gsub(sub_str, '')
  [str, (s.size - str.size) / 2]
end

s = 'cdbcbbaaabab'
x = 4
y = 5
puts maximum_gain(s, x, y)
s = 'aabbaaxybbaabb'
x = 5
y = 4
puts maximum_gain(s, x, y)
s = ''
x = 9150
y = 6050
bench = Benchmark.measure {
  puts maximum_gain(s, x, y) # 174833650
}
puts bench.real # in old algo 0.5665964190011437